import * as React from "react";
import pageData from "./DayView";

export default function Home(props: {pages: [pageData]}) {
  const [count, setCount] = React.useState("test");
  let increment = () => {
    setCount(count + 1);
  };
  let decrement = () => {
    setCount(count + 1);
  };
  return (
    <div>
      <main>
        <Table pages={props.pages} />
      </main>
    </div>
  );
}

type Pages = [pageData];
class Table extends React.Component {
  pages: [pageData]
  constructor(props: {pages: [pageData]}) {
    super(props);
    this.pages = props.pages
    // let p = [] as never;

  }

  render(): React.ReactNode {
    return (
      <table>
        <thead>
          <td>Summary</td>
          <td>Total HRS</td>
          <td>row ID</td>
        </thead>
        <tbody>
          {pages.map((page, ID, a) => {
            let tally = 0;
            if (page.table != undefined) {
              for (let row of page.table) {
                tally += row.hrs + 0;
              }
            }
            return (
              <tr id={ID.toString()}>
                <td>{page.goals}</td>
                <td>{tally}</td>
                <td>{ID}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    );
  }
}
